import logo from './logo.svg';
import './App.css';
import Content from './Components/Content';
import {Route, Router} from 'react-router-dom';
function App() {
  return (
    <>
    <Router>
      <Route path="/" component={Content}/>
    </Router>
    </>
  );
}

export default App;
